import React from 'react';
import PropTypes from 'prop-types';

class Entry extends React.Component {
    render() {
        const {
            title,
            subtitle,
        } = this.props;
        return (
            <div>
               {title}
               {subtitle}
            </div>
        );
    }
}

export default Entry;
